INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfAnInterfaceNamedStudentScriptsInEnglishOriginline28:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', NULL, NULL, NULL, NULL, 'StudentScripts', 'This interface gives a tutor an overview of the scripts submitted by\nstudents.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfConceptDefUserIDAtOriginline102:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adlInEnglishOriginline100:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adl', NULL, NULL, NULL, 'UserID', NULL, 'Het UserID (gebruikersnaam) van een account identificeert dat account en\nimpliciet daarmee ook diens eigenaar (d.w.z. de persoon die als enige\ngeacht wordt met dit account in te loggen. Een goed gebruik is om\nhiervoor een e-mailadres te gebruiken waarop de user van het account\nbereikbaar is.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfDeclarationassignment[Script*Assignment]InEnglishOriginline15:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', NULL, '17', NULL, NULL, NULL, 'In order to keep track of different scripts, the system can keep track\nof the assignment for which the script is an answer. Two scripts with\nthe same assignment and submittor will be treated as subsequent versions\nof the same script.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfDeclarationcontent[Script*ScriptContent]InEnglishOriginline20:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', NULL, '19', NULL, NULL, NULL, 'TODO', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfAPatternNamedRegistrationOfAmpersandSourceFilesInEnglishOriginline3:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', 'RegistrationOfAmpersandSourceFiles', NULL, NULL, NULL, NULL, 'As a student, I need to submit files for Ampersand to compile, so that I\ncan get functional specifications and all other goodies that Ampersand\nhas in store for me. In order to submit an Ampersand script in RAP3, the\nuser uploads text in the web-application. This pattern defines what\nadministration RAP3 will do in order before compiling the script/', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfARuleNamedSubmissionTimestampingInEnglishOriginline32:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', NULL, NULL, 'SubmissionTimestamping', NULL, NULL, 'To ensure that the submittor of every script is known, the following\nrule automatically stamps every script with its submittor and a\ntimestamp. The account logged in when creating a new script is\nconsidered to be the submittor.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfDeclarationsubmittor[Script*Account]InEnglishOriginline9:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', NULL, '16', NULL, NULL, NULL, 'RAP3 keeps separate workspaces for different users. For that purpose,\nRAP3 registers the account under which the script has been submitted. It\nregisters accounts rather than persons to minimize the amount of\npersonal data stored in RAP3.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfDeclarationsubmitted[Script*DateTime]InEnglishOriginline23:1,File/root/git/Ampersand-models/RAP3/Scripts.docadl', NULL, '18', NULL, NULL, NULL, 'Submitting a script is done by clicking on a submit-widget in the\nweb-application of RAP3. When files are already present when the\ndatabase is initialized, the corresponding script must be made and the\nfile creation date will be the submission date.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfConceptDefSESSIONAtOriginline121:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adlInEnglishOriginline111:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adl', NULL, NULL, NULL, 'SESSION', NULL, 'Een persoon gebruikt een gegevensruimte (en heet dan \'user\') door met\neen browser (bijv. Chrome of Firefox) het systeem te benaderen dat de\ngegegensruimte beheert. Als meerdere personen een gegevensruimte delen,\nmoet het systeem de context van elk van hen kunnen onderscheiden,\nbijvoorbeeld om:\n\n-   de interactie \'klein\' te houden, d.w.z. alleen gegevens te laten\n    zien die voor hem/haar relevant zijn;\n\n-   ervoor te zorgen dat een user niet ziet wat hij niet mag zien;\n\n-   te kunnen bijhouden welke persoon, of welk(e) organisatie(onderdeel)\n    verantwoordelijk is voor een zekere transactie;\n\n-   automatisch gegevens betreffende de user of zijn context aan\n    transacties toe te kunnen voegen\n\nWe gebruiken de term \'SESSION\' of \'session\' om de verzameling van\ngegevens betreffende n (actieve) user mee aan te geven. Deze term\ncorrespondeert met de gelijknamige term browsers gebruiken, nl. \'een\nverbinding (door de browser) met een webservice (die een URL heeft)\'.\nHet systeem houdt n session bij voor elke actieve user, d.w.z. voor\nelke browser die het systeem benadert. Merk op dat dit in het bijzonder\ngeldt als de user in verschillende tabbladen van dezelfde browser het\nsysteem benadert - er is dan toch maar n session (en n user).', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfConceptDefPasswordAtOriginline108:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adlInEnglishOriginline105:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adl', NULL, NULL, NULL, 'Password', NULL, 'Om het moeilijk te maken dat het Account van een zeker persoon door een\nander wordt gebruikt, registreert het systeem wachtwoorden. Door een\nwachtwoord geheim te houden ontstaat enige mate van zekerheid dat het\nsysteem gebruikt word door (dan wel met medeweten van) de persoon op\nwiens naam het wachtwoord is geregistreerd.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfConceptDefAccountAtOriginline98:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adlInEnglishOriginline96:1,File/root/git/Ampersand-models/SIAM/SIAM_Login.adl', NULL, NULL, NULL, 'Account', NULL, 'Als iemand inlogt in het systeem moet diens \'context\' worden\ngeactiveerd, d.w.z. de gegevens over de persoon die het systeem nodig\nheeft om te kunnen berekenen wat hij/zij wel en niet mag doen, en welke\ngegevens van het systeem daarbij mogen worden gebruikt. Om zulke\ncomputations te kunnen maken wordt een aantal zaken geregistreerd en aan\nn persoon gekoppeld.', '2017-06-17 20:44:53');
INSERT INTO `Purpose4` (`Purpose`, `purpose_1`, `purpose_2`, `purpose_3`, `purpose_4`, `purpose_5`, `markupText`, `ts_insertupdate`) VALUES('ExplObjExplanationOfConceptDefRoleAtOriginline51:1,File/root/git/Ampersand-models/SIAM/SIAM_Roles.adlInEnglishOriginline49:1,File/root/git/Ampersand-models/SIAM/SIAM_Roles.adl', NULL, NULL, NULL, 'Role', NULL, 'Niet iedereen mag alle gegevens uit een systeem inzien en/of wijzigen.\nOm de beheerslast te beperken die ontstaat als dit soort rechten per\npersoon wordt uitgegeven, gebruiken we het concept \'Role\'. Een Role\nwordt enerzijds toegekend aan Accounts (en daarmee aan Personen) en\nanderzijds wordt hij gebruikt om gegevens in te zien en/of te wijzigen.\nAls een user inlogt worden de Rollen die aan hem zijn toegekend in de\nsession geactiveerd (sessionrollen). Interfaces gebruiken deze\nsessionrollen om al dan niet gegevens te tonen en/of te editen.', '2017-06-17 20:44:53');
